import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Footer, getNavItems, Header, Home, Navbar } from "../components";

import "./App.scss";

function ProjectDetails({ project }) {
  return (
    <main className="ProjectDetails">
      <section>
        <p>{project.desc}</p>
        <ul>
          {project.tech.map((item) => (
            <li>{item}</li>
          ))}
        </ul>
        <p>{project.learned}</p>
        <p>{project.liked}</p>
        <p>{project.disliked}</p>
        <a href={project.gitDemoLink}>git demo</a>
      </section>
      <section>
        <img alt="mobile" />
        <img alt="desktop" />
      </section>
    </main>
  );
}

function PageMissing() {
  return <div>error 404</div>;
}

const routes = [
  { path: "/", component: Home },
  { path: "/home", component: Home },
  {
    path: "/projectdetails",
    render: (props) => <ProjectDetails props={props} />,
  },
  { path: "*", component: PageMissing },
];
function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar navItems={getNavItems()} />
        <Switch>
          {routes.map((route) => (
            <Route exact {...{ ...route }} />
          ))}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
